waves.frame_eqs_str:
advance=advance+ 0.009;
advance=if( above(advance,2) , advance-2, advance);
t1=advance

waves.point_eqs_str:
s=sample*6.28;

//plot random x position via function of sample pos;
xp=sin(s)+sin(s*0.34)+sin(s*24.3)+sin(s*13.8);
xp=xp*1.40;

//plot random y position via function of sample pos;
yp=cos(s)+sin(s*0.24)+cos(s*17.4)+sin(s*37.7);
yp=yp*1.40;

//plot random z position via function of sample pos;
zp=cos(s)+cos(s*5.24)+cos(s*47.4)+cos(s*27.7);
zp=zp*0.25;

//lateral movement
xp=xp+q4;
yp=yp+q5;

//correct when outside ranges
xp=if( below(xp,-6) , xp+12 , xp );
xp=if( above(xp, 6) , xp-12 , xp );
yp=if( below(yp,-6) , yp+12 , yp );
yp=if( above(yp, 6) , yp-12 , yp );

//pull stars toward screen
zp=zp - t1;

//keep stars in 2unit depth
zp=if( above(zp, 1) , zp-2 , zp );
zp=if( below(zp,-1) , zp+2 , zp );
zp=(zp+2)*2;

//add rotation
yp2= yp*cos(q6) - zp*sin(q6);
zp2= yp*sin(q6) + zp*cos(q6);
yp=yp2;
zp=zp2;
xp2= xp*cos(q7) - zp*sin(q7);
zp2= yp*sin(q7) + zp*cos(q7);
xp=xp2;
zp=zp2;

//darken far stars
a=(1 - (zp-10*0.5));
a=a*q1;
a=if( above(a,1), 1, a);
a=if( below(a,0), 0, a);

//push into viewspace change scale
zp=(zp-1.5)*1;
//a=if( below(zp,-2), 0, a);

x_screen=xp/zp + 0.5;
y_screen=yp/zp*1.25 + 0.5;

x=x_screen;
y=y_screen;

r=0.4*a;
g=0.6*a;
b=1.0;

